          var bottomExtender = $('#TWM_toggleMenu');
          if (bottomExtender.length)
            bottomExtender.remove();
          bottomMenu = $('<div id="TWM_bottombar"' + (TWM.get('EXPANDED_MENU', 'false') == 'true' ? ' class="expanded"' : '') + '><div class="menuBorder tw2gui_bg_tl"/><div class="menuBorder tw2gui_bg_tr"/><div class="menuBorder menuMiddle tw2gui_bg_bl"/><div class="menuBorder menuMiddle tw2gui_bg_br"/><div class="menuBorder tw2gui_bg_bl"/><div class="menuBorder tw2gui_bg_br"/></div>');
