            image = $('<img src="' + TWM.images.menu[this.bottom[b]] + '" onclick="' + TWM.entryList.details[this.bottom[b]] + '" title="' + (Mlang.entries[this.bottom[b]] || this.bottom[b]) + '">');
            entry.append(highlight, image);
